export const SET_DATA = '[dataSet]SET_DATA';
export const setData = data => dispatch => {

    const newSymbolList = data.map(record => {
        return record.symbol;
    })

    // dispatch(setSymbolList(newSymbolList));
    dispatch(setDisplayData(data));
};

export const SET_DISPLAY_DATA = '[dataSet]SET_DISPLAY_DATA';
export const setDisplayData = data => ({
        type: SET_DISPLAY_DATA,
        payload: data,
});

export const SET_SYMBOL_LIST = '[dataSet]SET_SYMBOL_LIST';
export const setSymbolList = list => ({
        type: SET_SYMBOL_LIST,
        payload: list,
});
